#' @param machineType The machine type of the instance
#' @param diskNames The names of the disks that were created for this pipeline
#' 
#' @return ComputeEngine object
#' 
#' @family ComputeEngine functions
#' @export


ComputeEngine <- function(instanceName = NULL, zone = NULL, machineType = NULL, diskNames = NULL) {
    
    
    
    structure(list(instanceName = instanceName, zone = zone, machineType = machineType, 
        diskNames = diskNames), class = "gar_ComputeEngine")
}

